settings.popupCss:
html {
  background-color: #ebe5d3;
  color: #657b83;
}

a {
  color: #268bd2;
}

.error,
.deleted {
  color: #dc322f;
}

.success,
.inserted,
.name {
  color: #859900;
}

.warning,
.modified {
  color: #b58900;
}

.type {
  color: #2aa198;
  font-style: italic;
}

.param {
  color: #cb4b16;
}

.current {
  text-decoration: underline;
}
